import React from 'react';
import {useHistory} from "react-router-dom";

const LoginUser = (props) => {
    const history = useHistory();


    return (
        <div>
            <header className="login-form"><h2>Login form</h2></header>
            <div className="login-card" style="font-family:Roboto, sans-serif;">
                <p class="profile-name-card"><i class="fa fa-unlock-alt d-inline" style={{
                    "width": "0",
                    "height": "0",
                    "font-size": "56px",
                    "color": "rgb(104,145,162)"
                }}></i></p>
                <form class="form-signin"><span class="reauth-email" style="margin:11px;"></span><input
                    class="form-control" type="email" id="inputEmail" required placeholder="Username" autofocus/><input
                    class="form-control" type="password" id="inputPassword" required placeholder="Password"
                />
                    <button class="btn btn-primary btn-block btn-lg btn-signin"
                            style={{"font-family":"Roboto, sans-serif" ,"font-size":"16px" ,"font-weight":"normal", "font-style":"normal"}}
                            type="submit">Sign in
                    </button>
                </form>
                <p class="text-center" style="color:rgb(73,80,87);font-size:11px;">Restricted Area</p>
            </div>
        </div>


    )


};
export default LoginUser;
